import React from "react";
import AdvancedAnalysis from "./AdvancedAnalysis";

const AnalysisWrapper = ({ analysis }) => {
  return (
    <div>
      {analysis?.advanced_analysis ? (
        <AdvancedAnalysis advancedAnalysis={analysis.advanced_analysis} />
      ) : (
        <div>No advanced analysis data available</div>
      )}
    </div>
  );
};

export default AnalysisWrapper;
